export class UserDTO {
  userID;
  username;
  password;
  userStatus;

  constructor(user?:any){
    user = user || {};
    this.userID  = user.userID || null;
    this.username  = user.username || '';
    this.password  = user.password || '';
    this.userStatus  = user.userStatus || '';
  }
}
